import "./App.css";

function App() {
  return (
    <body>
      <div class="colorlib-page">
        <div id="container-wrap">
          <aside
            id="colorlib-aside"
            role="complementary"
            class="border js-fullheight"
            style="height: 911px;"
          ></aside>
        </div>
      </div>
    </body>
  );
}

export default App;
